import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 Pankaj | All rights reserved.</p>
      <p>
        Contact me at: <a href="mailto:doleymiro49@gmail.com">doleymiro49@gmil.com</a>
      </p>
    </footer>
  );
};

export default Footer;
